送り状を入れてそのまま配送できるしっかりしたボストンバッグです。引き裂きや耐摩耗に優れた東レ「バリスターナイロン」を使用しています。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">送り状を入れてそのまま配送できるしっかりしたボストンバッグです。引き裂きや耐摩耗に優れた東レ「バリスターナイロン」を使用しています。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">外寸:W490×D190×H300mm</font><br><font color="#333333" size="-1">個装サイズ：50×33×4cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約860g</font><br><font color="#333333" size="-1">個装重量：870g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">東レ「バリスターナイロン(2520デニール)」(撥水加工)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">引き手が固定できる馬蹄錠金具付き<br>対応鍵サイズ:直径10mmまで(別売のサンワサプライ製ダイヤル錠大(SLE-4LN)や南京錠大(SLE-1L～)に対応)<br>クリアポケット付き<br>YKK製金属ファスナー採用<br>肩掛けも可<br>底板取り外し可<br>持ち手長さ:60cm</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
